import React from 'react'
import spotify from '../res/socials/spotify-128.png';
import linkedin from '../res/socials/linkedin.png';
import github from '../res/socials/github.png';
import stanley from '../res/socials/logo.png';
import styled from '@emotion/styled';

const Footer = () => {
  return (
    <FooterContainer>
      <div className='line'></div>
      <div className='second-row'>
        <p>
          <strong>&#169;</strong> <span>STANPODS</span> <br />
          RUN & BUILT BY STANLEY
        </p>
        <Socials>
          <img src={stanley} alt=''/>
          <img src={github} alt=''/>
          <img src={linkedin} alt=''/>
          <img src={spotify} alt=''/>
        </Socials>
      </div>

    </FooterContainer>
  )
}

const FooterContainer = styled.footer`
  display: flex;
  flex-direction: column;
  height: 200px;
  background-color: black;
  align-items: center;
  .line {
    height: 2px;
    width: 90vw;
    background-color: white;
  }
  .second-row {
    display: flex;
    justify-content: space-between;
    width: 90vw;
    p {
      margin-top: 20px;
      line-height: 2;
      color: white;
      font-family: GoodTime;
      span {
        font-family: Super Brigade;
        font-size: 34px;
      }
      strong {
        font-size: 25px;
      }
    }
  }
`

const Socials = styled.div`
  display: flex;
  > img {
    width: 50px;
    height: 50px;
    margin-right: 25px;
    margin-top: 30px

  }
`

export default Footer
